import './Login.css';
import {Link} from 'react-router-dom';

function Login() {




  return (
    <>
           {/* Left Part */}
           <div className="leftPart">
         <Link to="/"><p className="logo" >lulu school</p></Link>
         <div id = "register-info">
          <h3 id="header-w">Аккаунтқа кіру</h3>
          <form>

            <div className="form-group">
             <input name="email"  type="email" className="form-control" id="InputEmail1" aria-describedby="emailHelp" placeholder="Электрондық пошта"></input>
           </div>

            <div className="form-group">
              <input name="password" type="password"  className="form-control" id="InputPassword1" placeholder="Құпия сөз"></input>
            </div>

            <div className="form-group">
              <button id="login-button"  type="submit">Кіру</button>
            </div>

            <div className="form-group" id="word-in-bottom">
               <p>Аккаунтыңыз жоқ па? <Link to="#" id="links">Тіркелу</Link></p>
            </div>

          </form>
         </div>
       </div>
       
       
       {/* Right Part */}
       <div className="rightPart"></div>

    </>
  );
}

export default Login;
